Promotional info - &quot;One of Grant Morrison's most controversial and trippiest and abstract comic book titles! Follow the adventures of The Invisibles, a secret organization out to battle against physical and psychic oppression brought upon humanity by the interdemsional alien gods of the Archons of Outer Church!&quot;

Grant Morrison's wild, weird, wacky and wonderful series gets the Deluxe Edition treatment. This first volume collects Invisibles v1 01-12 + Absolute Vertigo 01. This pristine digital copy is care of Fawkes-Empire and is the best way to read this divisive modern era masterpiece. Thanks to F-E for their work, please seed and enjoy! :-)
